import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { MealPlanProvider } from "./context/MealPlanContext";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

root.render(
  <MealPlanProvider>
    <App />
  </MealPlanProvider>
);
